import React from 'react'; 
import "./style.scss";

const Header = () => {
    return (
    <header class="header">
        <img src="/images/logo.svg" alt="" /> 

        <ul class="header">
          <li><a href="google.com">Home</a></li>
          <li><a href="google.com">About</a></li>
          <li><a href="google.com">Projects</a></li>
          <li><a href="google.com">Content</a></li>
        </ul>
    </header>
    )
  }


export default Header;
